import React, { Component } from 'react'
import { Menu } from 'antd'
import {SmileTwoTone,HeartTwoTone,CheckCircleTwoTone} from '@ant-design/icons'
// import 'antd/dist/antd.css'
// const { RangePicker } = DatePicker;
// import PIC from './img/bg1.jpg'
const { SubMenu } = Menu;
export default class App extends Component {
    
    handleClick(e) {
        console.log('click', e);
    }
    render() {
        /* const contentStyle = {
            height: '160px',
            color: '#fff',
            lineHeight: '160px',
            textAlign: 'center',
            // background: '#364d79',
            backgroundImage: `url(${PIC})`
        }; */
        

        return (
            <div className='box'>
                {/* <button>点我</button>&nbsp;&nbsp;
                <Button type="primary">按钮1</Button>&nbsp;&nbsp;
                <Button>按钮2</Button>&nbsp;&nbsp;
                <Button type="link">按钮3</Button>&nbsp;&nbsp;
                <br />
                <hr />
                <WechatOutlined />&nbsp;&nbsp;&nbsp;&nbsp;
                <WeiboOutlined />
                <br />
                <DatePicker />
                <Carousel>
                    <div>
                        <h3 style={contentStyle}>1</h3>
                    </div>
                    <div>
                        <h3 style={contentStyle}>2</h3>
                    </div>
                    <div>
                        <h3 style={contentStyle}>3</h3>
                    </div>
                    <div>
                        <h3 style={contentStyle}>4</h3>
                    </div>
                </Carousel> */}
                
                <Menu className="menu" onClick={this.handleClick} style={{ width: 100 }} mode="vertical">
                    <SubMenu key="sub1" icon={<SmileTwoTone />}>
                        <Menu.ItemGroup title="Item 1">
                            <Menu.Item key="1">Option 1</Menu.Item>
                            <Menu.Item key="2">Option 2</Menu.Item>
                        </Menu.ItemGroup>
                        <Menu.ItemGroup title="Iteom 2">
                            <Menu.Item key="3">Option 3</Menu.Item>
                            <Menu.Item key="4">Option 4</Menu.Item>
                        </Menu.ItemGroup>
                    </SubMenu>
                    <SubMenu key="sub2" icon={<HeartTwoTone twoToneColor="#eb2f96" />} >
                        <Menu.Item key="5">Option 5</Menu.Item>
                        <Menu.Item key="6">Option 6</Menu.Item>
                        <SubMenu key="sub3" title="Submenu">
                            <Menu.Item key="7">Option 7</Menu.Item>
                            <Menu.Item key="8">Option 8</Menu.Item>
                        </SubMenu>
                    </SubMenu>
                    <SubMenu key="sub4" icon={<CheckCircleTwoTone twoToneColor="#52c41a" />}>
                        <Menu.Item key="9">Option 9</Menu.Item>
                        <Menu.Item key="10">Option 10</Menu.Item>
                        <Menu.Item key="11">Option 11</Menu.Item>
                        <Menu.Item key="12">Option 12</Menu.Item>
                    </SubMenu>
                </Menu>
            </div>
        )
    }
}
